import {
  PagesTopTitle,
  UserName,
  InfoCard,
  EmployeesChart,
  ReimbursementApp,
} from "../components/Pages/Dashboard/index";
const Dashboard = () => {
  return (
    <>
      <div className="custom_container">
        <UserName />
        <PagesTopTitle title="dashbaord" />
        <InfoCard />
        <EmployeesChart />
        <div className="row">
          <ReimbursementApp />
        </div>
      </div>
    </>
  );
};

export default Dashboard;
